import React from 'react';
import { Link } from 'react-router-dom';
import { Nav, NavDropdown, Dropdown, DropdownButton, Button } from 'react-bootstrap'
import { useNavigate } from "react-router-dom";
import './Navbar1.css';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';
import DropdownToggle from 'react-bootstrap/esm/DropdownToggle';
import DropdownMenu from 'react-bootstrap/esm/DropdownMenu';
function Navbar1(props) {

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light navbar-custom ">
        <div className="container-fluid">
          <a className="navbar-brand ">
            Employee Management System
          </a>
        </div>

        <NavbarCollapse id="basic-navbar-nav">
          <Nav className="ml-auto">
          </Nav>
        </NavbarCollapse>
        <Nav className="ml-auto">
          <Link to="/" ><Button style={{ backgroundColor: ' ', color: 'white' }} className='custom-button'>Home</Button></Link>
        </Nav>

<Dropdown>
        {/* <DropdownButton title="Login" className="custom-dropdown-button"> */}
          <Dropdown.Toggle variant='info' 
          >Login</Dropdown.Toggle>
           <DropdownMenu>
          {/* <NavDropdown.Divider></NavDropdown.Divider> */}
          <Dropdown.Item >
            <Link to="/Admin">
              Admin
            </Link>
          </Dropdown.Item>

          <Dropdown.Item >
            <Link to="/Manager">
              Manager
            </Link>
          </Dropdown.Item>

          <Dropdown.Item >
            <Link to="/Employee">
              Employee
            </Link>
          </Dropdown.Item>

          {/* <NavDropdown.Divider></NavDropdown.Divider> */}
          <Dropdown.Item href="/">

          </Dropdown.Item>
         </DropdownMenu>
        {/* </DropdownButton> */}
        </Dropdown>

      </nav>

    </div>
  );
}

export default Navbar1;
